from solution import Solution
import heapq
import math

# Correct solver using Dijkstra (priority by cost)

def is_prime(num):
    if num < 2:
        return False
    if num == 2:
        return True
    if num % 2 == 0:
        return False
    r = int(math.isqrt(num))
    for i in range(3, r+1, 2):
        if num % i == 0:
            return False
    return True


def correct_min_operations(n, m):
    # Early checks matching problem
    if len(str(n)) != len(str(m)):
        return -1
    if is_prime(n) or is_prime(m):
        return -1
    if n == m:
        return n
    num_digits = len(str(n))
    start = n
    target = m
    # Dijkstra
    dist = {start: start}
    pq = [(start, start)]  # (cost, node)
    while pq:
        cost, u = heapq.heappop(pq)
        if cost != dist.get(u, 1e30):
            continue
        if u == target:
            return cost
        s = str(u).zfill(num_digits)
        for i in range(num_digits):
            d = int(s[i])
            # inc
            if d < 9:
                t = list(s)
                t[i] = str(d+1)
                v = int(''.join(t))
                if len(str(v)) == num_digits and not is_prime(v):
                    new_cost = cost + v
                    if new_cost < dist.get(v, 10**18):
                        dist[v] = new_cost
                        heapq.heappush(pq, (new_cost, v))
            # dec
            if d > 0:
                t = list(s)
                t[i] = str(d-1)
                v = int(''.join(t))
                if len(str(v)) == num_digits and not is_prime(v):
                    new_cost = cost + v
                    if new_cost < dist.get(v, 10**18):
                        dist[v] = new_cost
                        heapq.heappush(pq, (new_cost, v))
    return -1


sol = Solution()

mismatches = []

# Test 1-digit exhaustive
nums1 = list(range(1,10))
for n in nums1:
    for m in nums1:
        res1 = sol.minOperations(n, m)
        res2 = correct_min_operations(n, m)
        if res1 != res2:
            mismatches.append(((n,m), res1, res2))

# Test 2-digit exhaustive
nums2 = list(range(10, 100))
for n in nums2:
    for m in nums2:
        res1 = sol.minOperations(n, m)
        res2 = correct_min_operations(n, m)
        if res1 != res2:
            mismatches.append(((n,m), res1, res2))

# Sample 3-digit and 4-digit random pairs
import random
random.seed(0)
nums3 = list(range(100,1000))
nums4 = list(range(1000,10000))
pairs = []
for _ in range(500):
    n = random.choice(nums3)
    m = random.choice(nums3)
    pairs.append((n,m))
for _ in range(500):
    n = random.choice(nums4)
    m = random.choice(nums4)
    pairs.append((n,m))

for n,m in pairs:
    res1 = sol.minOperations(n, m)
    res2 = correct_min_operations(n, m)
    if res1 != res2:
        mismatches.append(((n,m), res1, res2))

# Some targeted tests
# starting as prime or target as prime should be -1
for n in [2,3,5,7,11,13,17,19]:
    for m in [22,33]:
        res1 = sol.minOperations(n,m)
        res2 = correct_min_operations(n,m)
        if res1 != res2:
            mismatches.append(((n,m), res1, res2))

# Print results summary
print('Total mismatches:', len(mismatches))
for i, item in enumerate(mismatches[:20]):
    print(i+1, item)

# Exit code 0 and write mismatches to a file for later review
with open('mismatches.txt', 'w') as f:
    f.write('Total mismatches: %d\n' % len(mismatches))
    for item in mismatches:
        f.write(str(item) + '\n')

